import io from "socket.io-client"
import React, { Component } from "react"

class App2 extends Component {
    state = {
        socket: null,
    }

    componentDidMount() {
        this.initsocket()
    }

    initsocket = () => {
        const socket = io("/")
        this.setState({ socket })
        socket.on("connect", () => {
            console.log("connected")
        })
    }

    render() {
        return <div>Hi</div>
    }
}

export default App2
